    "2013-03-15T14:33:53.985397",nt"name": "naip-1m-clrir-2008",nt"isopen":
    false,nt"url": null,nt"notes": "The NAIP_1M_CLRIR_2008 dataset is a 1:40000
    scale (1 meter) truecolor and infrared (4 band) NAIP imagery product acquired during
    the summer of 2008. This data set contains imagery from the National Agriculture
    Imagery Program (NAIP). NAIP acquires digital ortho imagery during the agricultural
    growing seasons in the continental U.S.. A primary goal of the NAIP program is to
    enable availability of of ortho imagery within one year of acquisition. NAIP provides
    four main products: 1 meter ground sample distance (GSD) ortho imagery rectified
    to a horizontal accuracy of within +/- 5 meters of reference digital ortho quarter
    quads (DOQQ's) from the National Digital Ortho Program (NDOP); 2 meter GSD ortho
    imagery rectified to within +/- 10 meters of reference DOQQs; 1 meter GSD ortho
    imagery rectified to within +/- 6 meters to true ground; and, 2 meter GSD ortho
    imagery rectified to within +/- 10 meters to true ground. The tiling format of NAIP
    imagery is based on a 3.75' x 3.75' quarter quadrangle with a 300 meter buffer on
    all four sides. NAIP quarter quads are formatted to the UTM coordinate system using
    NAD83. NAIP imagery may contain as much as 10% cloud cover per tile.",nt"license_title":
